var grunt = require("grunt");
var encode = require("../tasks/lib/encode").init(grunt);

var linefeed = grunt.util.linefeed;
var encoded_gif = "data:image/gif;base64,";
var encoded_eot = "data:application/vnd.ms-fontobject;base64,";
var encoded_woff = "data:application/font-woff;base64,";
var encoded_tff = "data:application/x-font-ttf;base64,";
var encoded_svg = "data:image/svg+xml;base64,";

/*
  Assumptions: test_image_encoder tests pass.
*/

exports['test css encoding'] = {

  "trivial case -- can process a basic css file": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_trivial.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, "body { }" + linefeed);
      test.done();
    });
  },

  "can encode single url on a line -- no quotes": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_singleurl.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, 'body { background-image: url("' + encoded_gif + '"); }' + linefeed);
      test.done();
    });
  },

  "can encode single url on a line -- with quotes": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_singleurl_withquotes.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, 'body { background-image: url("' + encoded_gif + '"); }' + linefeed);
      test.done();
    });
  },

  "can fetch external urls": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_singleurl_external.css";
    encode.stylesheet(input, {
      skipExternal: false
    }, function(err, str) {
      test.equal(str, 'body { background-image: url("' + encoded_gif + '"); }' + linefeed);
      test.done();
    });
  },

  "can skip external urls": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_singleurl_external.css";
    encode.stylesheet(input, {
      skipExternal: true
    }, function(err, str) {
      test.equal(str, 'body { background-image: url("https://raw.github.com/jpunt/grunt-css-url-rewrite/master/test/css/images/test.gif"); }' + linefeed);
      test.done();
    });
  },

  "can encode more than one url on a line": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_multiurl_oneline.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, 'body { background-image: url("' + encoded_gif + '"); background-image: url("' + encoded_gif + '"); }' + linefeed);
      test.done();
    });
  },

  "can rewrite url": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_rewrite.css";
    encode.stylesheet(input, {
      rewriteUrl: function(url) {
        url = url.replace(__dirname + "/css", "");
        return '/v-1234' + url;
      }
    }, function(err, str) {
      test.equal(str, 'body { background-image: url("/v-1234/images/test.gif?parameters=keep"); }' + linefeed);
      test.done();
    });
  },

  "can rewrite url - strip parameters": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_rewrite_strip_parameters.css";
    encode.stylesheet(input, {
      stripParameters: true,
      rewriteUrl: function(url) {
        url = url.replace(__dirname + "/css", "");
        return '/v-1234' + url;
      }
    }, function(err, str) {
      test.equal(str, 'body { background-image: url("/v-1234/images/test.gif"); }' + linefeed);
      test.done();
    });
  },

  "can ignore line": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_ignore.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, 'body { background-image: url("images/test.gif"); }' + linefeed);
      test.done();
    });
  },

  "can encode url for a eot-font": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_font_eot.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, '@font-face { src: url("' + encoded_eot + '"); }' + linefeed);
      test.done();
    });
  },

  "can encode url for a woff-font": function(test) {
    test.expect(1);
    var input = __dirname + "/css/test_font_woff.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, '@font-face { src: url("' + encoded_woff + '"); }' + linefeed);
      test.done();
    });
  },

  // "can encode url for a tff-font": function(test) {
  //   test.expect(1);
  //   var input = __dirname + "/css/test_font_tff.css";
  //   encode.stylesheet(input, function(err, str) {
  //     test.equal(str, '@font-face { src: url("' + encoded_tff + '"); }' + linefeed);
  //     test.done();
  //   });
  // },

  // "can encode url for a svg-font": function(test) {
  //   test.expect(1);
  //   var input = __dirname + "/css/test_font_svg.css";
  //   encode.stylesheet(input, function(err, str) {
  //     test.equal(str, '@font-face { src: url("' + encoded_svg + '"); }' + linefeed);
  //     test.done();
  //   });
  // },

  "issue: can't do more than one url": function(test) {
    test.expect(1);
    var input = __dirname + "/css/sub/test_multiurl_oneline.css";
    encode.stylesheet(input, function(err, str) {
      test.equal(str, 'body { background-image: url("' + encoded_gif + '"); background-image: url("' + encoded_gif + '"); }' + linefeed);
      test.done();
    });
  },
};
